import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import AuthContext from '../context/AuthContext';

const Header = () => {
    const { authTokens } = useContext(AuthContext)

    return (
        <header className="p-4 font-song text-xl bg-white shadow-md">
    <nav className="flex items-center justify-between">
        <h1 className="text-black font-bold ml-16"><Link to="/">Asset Eye</Link></h1>
        <ul className="flex space-x-16 mr-16">
            <li className="text-black hover:underline"><Link to="/">Home</Link></li>
            {authTokens ? 
                <>
                <li className="text-black hover:underline"><Link to="/explore">Explore</Link></li>
                <li className="text-black hover:underline"><Link to="/dashboard">Watchlist</Link></li>
                </>
                : <li className="text-black hover:underline"><Link to="/register">Create Account</Link></li>
            }
        </ul>
    </nav>
</header>
    )
}

export default Header
